import logo1 from "../icons/gologo.png";
import logo2 from "../icons/ginLogo.svg";
import logo3 from "../icons/reactLogo.svg";
import logo4 from "../icons/tailwindLogo.svg";

function Content_Homepage() {
  return (
    <section className="flex flex-row justify-around h-auto">
      <div className="basis-1/4">
        <div className="text-center">
          <img className="w-24 mx-auto" src={logo3} />
          <p> React</p>
          <p>
            Creo interfaces por componentes para mantener mi trabajo limpio y
            ordenado
          </p>
        </div>
      </div>
      <div className="basis-1/4">
          <div className="text-center">
          <img className="h-24 mx-auto" src={logo4} />
          <p> React</p>
          <p>
            Creo interfaces por componentes para mantener mi trabajo limpio y
            ordenado
          </p>
          </div>
      </div>
      <div className="basis-1/4"></div>
    </section>
  );
}

export default Content_Homepage;
